venue_details = [{'ground': 'Perth Stadium', 'city': 'Perth', 'country': 'Australia', 'timezone': '+08:00', 'capacity': '60000', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/512.jpg', 'imageId': '189174'}, {'ground': 'Grand Prairie Stadium', 'city': 'Dallas', 'country': 'United States', 'timezone': '-05:00', 'established': 2022, 'capacity': '7000', 'knownAs': 'AirHogs Stadium', 'homeTeam': 'Texas Super Kings', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/1668.jpg', 'otherSports': 'Baseball', 'imageId': '717723'}, {'ground': 'VRA Cricket Ground', 'city': 'Amstelveen', 'country': 'Netherlands', 'timezone': '+02:00', 'capacity': '4500', 'ends': "City End, Mulder's End", 'homeTeam': 'VRA Cricket', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/264.jpg', 'imageId': '189174'}, {'ground': 'Bay Oval', 'city': 'Mount Maunganui', 'country': 'New Zealand', 'timezone': '+13:00', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/393.jpg', 'imageId': '189174'}, {'ground': 'Maple Leaf North-West Ground', 'city': 'King City', 'country': 'Canada', 'timezone': '-04:00', 'knownAs': 'Maple Leaf 1A, Ground 1', 'ends': 'Northern End, Southern End', 'homeTeam': 'Canada', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/139.jpg', 'imageId': '189174'}, {'ground': 'United Cricket Club Ground', 'city': 'Windhoek', 'country': 'Namibia', 'timezone': '+02:00', 'knownAs': 'TrustCo United Sports Field', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/524.jpg', 'imageId': '189174'}, {'ground': 'Sharjah Cricket Stadium', 'city': 'Sharjah', 'country': 'United Arab Emirates', 'timezone': '+04:00', 'established': 1982, 'capacity': '16,000', 'ends': 'Pavilion End, Sharjah Club End', 'homeTeam': 'United Arab Emirates', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/140.jpg', 'imageId': '731715'}, {'ground': 'Central Broward Regional Park Stadium Turf Ground', 'city': 'Lauderhill, Florida', 'country': 'United States', 'timezone': '-04:00', 'established': 2007, 'capacity': '20000', 'knownAs': 'Central Broward Stadium, The CBRSP', 'ends': 'North End, Pavilion End', 'homeTeam': 'United States of America', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/270.jpg', 'otherSports': 'Rugby, Soccer, Australian Rules Football', 'imageId': '717730'}, {'ground': 'Bert Sutcliffe Oval', 'city': 'Lincoln', 'country': 'New Zealand', 'timezone': '+13:00', 'knownAs': 'BIL Oval', 'ends': 'Pavilion End, City End', 'homeTeam': 'New Zealand Academy', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/269.jpg', 'imageId': '189174'}, {'ground': 'R.Premadasa Stadium', 'city': 'Colombo', 'country': 'Sri Lanka', 'timezone': '+05:30', 'established': 1986, 'capacity': '35,000', 'knownAs': 'Khettarama Stadium (until June 1994)', 'ends': 'Khettarama End, Scoreboard End', 'homeTeam': 'Sri Lanka', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/15.jpg', 'imageId': '717741'}, {'ground': 'Kennington Oval', 'city': 'London', 'country': 'England', 'timezone': '+01:00', 'established': 1845, 'capacity': '23500', 'knownAs': "The Oval; The AMP Oval; The Foster's Oval; The Brit Oval", 'ends': 'Pavilion End, Vauxhall End', 'homeTeam': 'England, Surrey', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/12.jpg', 'imageId': '717717'}, {'ground': 'Trent Bridge', 'city': 'Nottingham', 'country': 'England', 'timezone': '+01:00', 'established': 1841, 'capacity': '15,350 (to be 17,000)', 'knownAs': 'Trent Bridge Ground', 'ends': 'Pavilion End, Radcliffe Road End', 'homeTeam': 'Nottinghamshire', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/18.jpg', 'otherSports': 'Football (Nottm Forest and Notts County) 1860-1910', 'imageId': '189174'}, {'ground': 'Prairie View Cricket Complex', 'city': 'Houston', 'country': 'United States', 'timezone': '-05:00', 'established': 2018, 'capacity': '10,000', 'knownAs': 'Kalsoom Prairie View Cricket Association', 'ends': 'Forest End, Highway End', 'homeTeam': 'United States of America', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/915.jpg', 'imageId': '189174'}, {'ground': "Lord's", 'city': 'London', 'country': 'England', 'timezone': '+01:00', 'established': 1814, 'capacity': '30000', 'knownAs': "Lord's Cricket Ground", 'ends': 'Pavilion End, Nursery End', 'homeTeam': 'Marylebone Cricket Club, Middlesex', 'floodlights': True, 'curator': 'Mick Hunt', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/19.jpg', 'otherSports': 'Lacrosse, Hockey, Archery (2012 Olympics)', 'imageId': '717711'}, {'ground': 'The Rose Bowl', 'city': 'Southampton', 'country': 'England', 'timezone': '+01:00', 'established': 2001, 'capacity': '6,500 (20,000 with temporary seating)', 'knownAs': 'The Ageas Bowl, West End', 'ends': 'Pavilion End, Northern End', 'homeTeam': 'Hampshire, Hampshire 2nd XI', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/21.jpg', 'imageId': '189174'}, {'ground': 'Edgbaston', 'city': 'Birmingham', 'country': 'England', 'timezone': '+01:00', 'established': 1882, 'capacity': '21,000', 'ends': 'City End, Pavilion End', 'homeTeam': 'Warwickshire', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/20.jpg', 'imageId': '717715'}, {'ground': 'Holkar Cricket Stadium', 'city': 'Indore', 'country': 'India', 'timezone': '+05:30', 'knownAs': 'Maharani Usharaje Trust Cricket Ground', 'ends': 'GAIL-Madhav Rao Scindia End, Pavilion End', 'homeTeam': 'Madhya Pradesh', 'floodlights': True, 'profile': "<b>Venue Description:</b>\n\nThe Holkar stadium, formerly known as Maharani Usharaje Trust Cricket Ground, has staged quite a few ODIs. When India came face-to-face against England on April 15, 2006, the Holkar stadium became the 156th ODI venue in this country. It also hosts most of Madhya Pradesh's Ranji Trophy matches and Duleep Trophy encounters. The Kerala Tuskers too played a couple of their IPL games at this venue in 2011.\n\nIntriguingly, it is also the venue, where Virender Sehwag thwacked West Indies' attack to all corners of the ground and cracked a sparkling knock of 219 in 2011. The ground has state-of-the-art facilities. The floodlit stadium has a seating capacity touching 30,000, which is the norm for most cricket grounds in the smaller cities of India. In 2011, the Pavilions were named after C.K Nayudu and Mushtaq Ali.\n\n<b>Pitch Conditions:</b>\n\nThe wicket at the Holkar stadium usually favours the batsmen. With even bounce and short boundaries coming into play, batsmen tend to rule the roost. On expected lines, Sehwag played with sparkle and fizz, and composed that record-breaking double ton against the West Indies in 2011. Even if we go further back in time to 2006, India chased down a target a 289 set by England with seven wickets to spare.", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/152.jpg', 'imageId': '189174'}, {'ground': 'GB Oval', 'city': 'Szodliget', 'country': 'Hungary', 'timezone': '+02:00', 'homeTeam': 'Hungary', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/1689.jpg', 'imageId': '189174'}, {'ground': 'Dubai International Cricket Stadium', 'city': 'Dubai', 'country': 'United Arab Emirates', 'timezone': '+04:00', 'capacity': '25,000', 'knownAs': 'Dubai Sports City Cricket Stadium', 'ends': 'Emirates Road End, Dubai Sports City End', 'homeTeam': 'United Arab Emirates', 'floodlights': True, 'curator': 'Tony Hemming', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/153.jpg', 'imageId': '731713'}, {'ground': 'SV Kampong CC', 'city': 'Kampong, Utrecht', 'country': 'Netherlands', 'timezone': '+02:00', 'knownAs': 'Sportpark Maarschalkerweerd', 'homeTeam': 'Netherlands', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/283.jpg', 'imageId': '189174'}, {'ground': 'Dr. Y.S. Rajasekhara Reddy ACA-VDCA Cricket Stadium', 'city': 'Visakhapatnam', 'country': 'India', 'timezone': '+05:30', 'established': 2003, 'capacity': '28,000', 'ends': 'Vizzy End, DV Subba Rao End', 'homeTeam': 'Andhra', 'floodlights': True, 'profile': '<b>Venue Description</b>\n\nACA-VDCA Cricket Stadium, located in Pothinamallayya Palem, Visakhapatnam, is surrounded by the blissful facade of the picturesque hills and the leafy ramble of trees swaying in breeze. It is the home ground of Sunrisers Hyderabad in the Indian Premier League. The stadium built in 2003 is known for its excellent drainage facilities. The well-manicured, lush-green outfield at the ground has also come in for praise. The seating capacity is expected to be increased to 50,000. In fact, the Test status was also granted recently. It is the ninth ground to be awarded the Test status in India.\n\nThe first ever international match at this stadium took place between arch-rivals India and Pakistan in April 2005. It was a game in which MS Dhoni announced his arrival at the highest level with a blistering innings of 148. Since then, it has gone on to host five ODIs, one T20I and IPL fixtures related to Deccan Chargers in 2012. Sunrisers Hyderabad are expected to play three games in 2015 in the IPL. \n\n<b>Pitch Conditions</b>:\n\nHistorically, it is known for producing belters, where batsmen can play through the line on even-paced wickets. However, in recent times, spinners have made their mark. It can be exemplified by some low-scoring games in the 2013-14 Syed Mushtaq Ali Trophy.\n\nby <b>Bharath Ramaraj</b>', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/154.jpg', 'imageId': '731711'}, {'ground': 'Himachal Pradesh Cricket Association Stadium', 'city': 'Dharamsala', 'country': 'India', 'timezone': '+05:30', 'established': 2003, 'capacity': '23000', 'ends': 'River End, College End', 'homeTeam': 'Himachal Pradesh, Punjab Kings', 'floodlights': True, 'profile': "<b>Venue description:</b>\n\nSitting at 1457 metres above sea level, the Himachal Pradesh Cricket Association (HPCA) Stadium in Dharamsala, is widely regarded as the most picturesque cricket stadium in the world. With the beautiful Dhauladhar mountain range lacing its backdrop, the HPCA stadium offers one of the most stunning views to its visitors, especially when the mighty peaks are blanketed in snow. \n\nEven though international cricket made its first appearance here only in 2013, the HPCA stadium has already established itself as a world-class cricket destination in a very short time. Best known for being the abode of the Dalai Lama, this quaint little town first found its place on the cricketing world map in 2010, when Chennai Super Kings locked horns with Kings XI Punjab in the Indian Premier League (IPL).\n\n<b>How does the pitch play?</b>\n\nWith India losing their recent T20I against South Africa even after setting an imposing target of 200, one can easily make out that the pitch here usually offers a lot of runs. Since the ground is located at a high altitude, the ball travels faster as well. In addition, the dew becomes a major factor in the evening if you're playing during the September-March period. That's the reason why teams prefer to chase at this venue.\n\nApart from eight IPL games, the ground has also hosted two ODIs. The first ODI at this stadium may have been a dull encounter, but India made up for it by making 330 in their next game here. Virat Kohli made 127 in that match as India managed to beat the West Indies by 59 runs, despite Marlon Samuels cracking a 106-ball 112.\n\nBy <b>Sidhant Maheshwari</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/155.jpg', 'imageId': '189174'}, {'ground': 'Eden Gardens', 'city': 'Kolkata', 'country': 'India', 'timezone': '+05:30', 'established': 1864, 'capacity': '63000', 'ends': 'High Court End, Pavilion End', 'homeTeam': 'Bengal, Kolkata Knight Riders', 'floodlights': True, 'curator': 'Probir Mukherjee', 'profile': '<b>Venue Description</b>:\n\nOne of the biggest sporting centres, Kolkata\'s Eden Garden holds a special place of interest in the history of Indian cricket. Capable of holding more than one lakh people at one stage, the capacity has now been reduced to a little more than 66,000 after the stadium underwent renovation before the 2011 World Cup.\n\nReferred as "Cricket\'s answer to the Colosseum," the Eden Gardens, the largest cricket stadium in India, has hosted many prominent matches. The Eden Gardens crowd simply loves their sport. The first World Cup final outside Lord\'s was at this majestic venue. Anil Kumble\'s 6/12 against West Indies in the final of the 1993 Hero Cup was on this hallowed turf.  \n\nSachin Tendulkar\'s famous run-out during the Asian Test Championship match against Pakistan, resulted in Kolkata\'s mob fury in action once again - the match was eventually finished in front of empty stands. This wasn\'t the first time though - not to forget the previous instance, when India slumped to 120/8, chasing 252 against Sri Lanka in the semi-final of the 1996 World Cup. \n\nThere have been happier times as well. The 376-run stand between VVS Laxman and Rahul Dravid during the famous 2001 Test series against Australia, which inspired a famous Indian victory, came here. Rohit Sharma\'s belligerent ODI world record, a 173-ball 264, against Sri Lanka, in Nov 2014, also came on this famous ground.\n\nThe stadium hosted its first Test in 1934, with India hosting England. While the Test match came early, it had to wait until 1987 to host its first ODI, against Pakistan. While the stadium is synonymous with cricket, until 1984, it was also used as a football venue, with several of prominent derbies being held over the maidan. \n\n<b>How does the pitch play?</b>\n \nThe Eden Gardens track is considered as one of the better batting surfaces although spinners tend to come into action as the match wears on. Spinners have enjoyed bowling here in IPL games as well.\n\n<b>Stats and Trivia</b>\n\nThe highest ODI score by any batsman was made on this ground. Rohit Sharma smashed 264 against Sri Lanka in November, 2014\n\nEden Gardens has hosted as many as 39 Tests - the most by any venue in India.\n\nby <b>Pradeep Krishnamurthy</b>', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/31.jpg', 'imageId': '189174'}, {'ground': 'Sydney Cricket Ground', 'city': 'Sydney', 'country': 'Australia', 'timezone': '+11:00', 'established': 1854, 'capacity': '48,000', 'knownAs': 'Sydney Cricket Ground No. 1; Garrison Ground (1848-1877), Association Ground', 'ends': 'Paddington End, Randwick End', 'homeTeam': 'New South Wales, Sydney Sixers', 'floodlights': True, 'curator': 'Tom Parker', 'profile': "<b>Venue description:</b>\n\n One of the oldest Test venues, Sydney Cricket Ground (SCG) hosted its first Test an Ashes encounter between Australia and England, way back in 1882. A Test regular, Sydney usually holds the popular 'New Year Test' that is generally played in the first week of January. The ground is also a pre-dominant ODI venue and has hosted numerous final matches as well as the crucial semi-final in the 1992 World Cup. One of the most popular sporting venues across the world, SCG was the ground where Sir Don Bradman made his highest ever first class score of 452, for New South Wales against Queensland in 1928-29.\n\n<b>How does the pitch play?</b>\n\nSydney is known to be a good batting wicket, with the spinners coming into the picture on days 4 and 5 of a Test match. It doesn't offer the true bounce of the Gabba or the raw pace of the WACA, but turns which ensures spinners have one venue in Australia to look forward to rolling their arm over.\n\nBy <b>Pradeep Krishnamurthy</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/34.jpg', 'groundLength': 156.0, 'groundWidth': 154.0, 'otherSports': 'Australian Rules Football (Sydney Swans)', 'imageId': '189174'}, {'ground': 'The Gabba', 'city': 'Brisbane', 'country': 'Australia', 'timezone': '+10:00', 'established': 1895, 'capacity': '42000 (approx)', 'knownAs': 'The Gabba', 'ends': 'Stanley Street End, Vulture Street End', 'homeTeam': 'Queensland, Brisbane Heat', 'floodlights': True, 'curator': 'Kevin Mitchell jnr', 'profile': '<b>Venue description:</b>\n\nThe stadium is named after the Brisbane suburb of Woolloongabba, in which it is located. A 42,000 seat stadium with state-of-art facilities, the Gabba also caters to other sports - American Rules Football, Soccer, Rugby Union and even Greyhound racing. The Gabba usually hosts the first Test match of the season every November. Since its first Test in 1931, the ground has undergone drastic renovations to become one of the finest Down Under.\n\nNotably, the first ever tied Test took place at this venue in 1960. It also holds the distinction of being the first Australian venue to host a T20I.\n\n<b>How does the pitch play?</b>\n\nThe Gabba is considered to be the truest wicket available in Australia. It generally offers healthy bounce and carry to the quicks while the stroke-makers thrive on the consistent bounce available. Kevin Mitchell jnr is regarded to be the best groundsman in Australia and has resisted the calls for a drop-in pitch, saying it will be difficult to replicate the traditional characteristics, if a drop-in pitch was installed.\n\nBy <b>Deivarayn Muthu</b>', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/35.jpg', 'groundLength': 170.6, 'groundWidth': 149.9, 'otherSports': 'Australian Rules Football (Brisbane Lions), Rugby Union, Athletics, Baseball, Cycling, Greyhound Racing, Pony Racing, Rugby League, Soccer', 'imageId': '189174'}, {'ground': 'JSCA International Stadium Complex', 'city': 'Ranchi', 'country': 'India', 'timezone': '+05:30', 'knownAs': 'Jharkhand State Cricket Association Stadium', 'floodlights': True, 'profile': "<b>Venue Description</b>:\n\nJSCA International Stadium Complex or formerly known as Jharkhand States Cricket Association International Cricket Stadium is situated in Ranchi. The first ODI at the ground was played between India and England on January 19, 2013.  Since then, two more ODIs have been played at this ground. The stadium has also hosted six IPL games.  \n\nIt is a well-planned stadium. To provide fans shade from the scorching sun, membrane roofing system has been used. When matches are played during the winter season in India, there is always a problem of long shadows leading to the Day's play being called off. The builders of JSCA International Stadium Complex have constructed the stadium by keeping that problem in mind. \n\nThe stadium also boasts of  Indoor Cricket center made up of three pitches. One of the interesting aspects of the stadium is that it is just a 10-minute drive from the airport. Four-lane roads provide good connectivity as well. The stadium is surrounded by the 17th century Jagannath Temple, Heavy Engineering Corporation Plant and Hatia Dam. \n\n<b>Pitch conditions:</b>\n\nAs it is a relatively big stadium, spinners tend to play a part at the ground. The track also offers the spinners grip and turn. Ravindra Jadeja of Chennai Super Kings has certainly taken advantage of the conditions on offer with his left-arm spin. In IPL 2014, he took eight wickets in just four games at the venue. On most occasions, 150 can turn out to be a competitive score at the ground.\n\nby <b>Bharath Ramaraj</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/291.jpg', 'imageId': '189174'}, {'ground': 'Al Amerat Cricket Ground (Ministry Turf 1)', 'city': 'Al Amerat', 'country': 'Oman', 'timezone': '+04:00', 'established': 2012, 'knownAs': 'Oman Cricket Academy Ground', 'ends': 'Al Amerat End, Pavilion End', 'homeTeam': 'Oman', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/549.jpg', 'imageId': '189174'}, {'ground': 'Niranjan Shah Stadium', 'city': 'Rajkot', 'country': 'India', 'timezone': '+05:30', 'established': 2009, 'capacity': '28,000', 'knownAs': 'Khandheri Cricket Stadium', 'homeTeam': 'Saurashtra', 'floodlights': True, 'profile': "<b>Venue Description:</b> \n\nA land of 30 acres was sanctioned in 2004 near the Jamnagar highway to build this state-of-the-art cricket stadium. The construction began in 2006 and almost 75 crores was spent. The media box at the venue resembles the one at Lord's and also for the spectators to move freely, there are several aisles between the seats. It also caters as a sporting complex to various other sports like badminton, volleyball and basketball. \n\nThere are also two grounds for cricket. One is the main ground which started hosting first-class matches in 2009 and is 90 metres. The other, which is right beside, is 70 metres long and is mainly used for district games. The stadium plays hosts for Saurashtra Cricket Association (SCA) along with the Madhavrao Scindia Cricket Ground. \n\nThe venue holds together more than 60 hospitality boxes, but the SCA are against selling the tickets to corporates and only give them during an international game.   \n\n<b>How does the pitch play?</b>\n\nThe Ranji home team players Cheteshwar Pujara and Ravindra Jadeja scored triple hundreds on this ground. That should give a fair indication as to what type of wicket we can expect here - it is of course batsmen-friendly. In the two international matches played at this venue, both were high-scoring encounters. First was an ODI between England and India - the visitors scored 325 and the hosts fell short by 9 runs. \n\nThe other game played here was a T20I involving Australia and India. The Aussies riding on the back of Aaron Finch's 89 set a target of 202. Yuvraj Singh won the game for India with two balls to spare, with his quickfire unbeaten 35-ball 77.", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/290.jpg', 'imageId': '189174'}, {'ground': 'Bellerive Oval', 'city': 'Hobart', 'country': 'Australia', 'timezone': '+11:00', 'established': 1914, 'capacity': '20,000', 'knownAs': 'Blundstone Arena', 'ends': 'Church Street End, River End', 'homeTeam': 'Tasmania, Hobart Hurricanes', 'floodlights': True, 'curator': 'Marcus Pamplin', 'profile': "<b>Venue description:</b>\n\nBellerive Oval is also known as Blundstone Arena, their sponsor name. It is located in the City of Clearence on the eastern side of Hobart, Tasmania. In 1977, Tasmania qualified for the Sheffield Shield and the Tasmanian Cricket Association decided to choose Bellerive Oval as their home ground ahead of KGV Oval and North Hobart Oval. The stadium underwent reconstruction at the start of the century. It cost the TCA $16 million for the reconstruction which includes: state-of-art indoor nets, a 6000 seat Southern Stand that included the new television media centre, members area, players area and TCA offices.\n\nThe first international game was played between Sri Lanka and New Zealand, an ODI in 1988. The following year, Australia hosted Sri Lanka in a Test match - the ground's maiden Test. The Oval is also the home for North Melbourne Football Club, the AFL (Australian Football League) team.\n\n<b>How does the pitch play?</b>\n\nPitches at the ground often prove slow in pace early and then gradually flatten out. Ever since the characteristics have been changed, games are now featuring a more even struggle between bat and ball.\n\nBy <b>Akshay Manaay</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/39.jpg', 'groundLength': 175.0, 'groundWidth': 135.5, 'otherSports': "Australian Rules (Clarence 'Roos [SFL], Tasmanian Devils [VFL])", 'imageId': '189174'}, {'ground': 'Adelaide Oval', 'city': 'Adelaide', 'country': 'Australia', 'timezone': '+10:30', 'established': 1871, 'capacity': '53,583 (including standing room)', 'knownAs': 'The Adelaide Oval', 'ends': 'City End, Cathedral End', 'homeTeam': 'South Australia and Adelaide Strikers', 'floodlights': True, 'curator': 'Damien Hough', 'profile': '<b>Venue description:</b>\n\n The Adelaide Oval nestled across the backdrop of magnificence of glorious gardens and swaying trees makes for a scenic ground.\n\nRedevelopment of the ground between 2008 and 2014 at a cost of $575 million that involved constructing two new stands at the Southern and Eastern sides of the ground have perhaps taken away the blissful facade surrounding the stadium. However, the Northern hill, iconic Moreton Bay Figs and heritage scoreboard still give you a feeling of nostalgia.\n\nThe stadium hosted its first ODI back in 1975 when Australia took on the West Indies. Over the years, many riveting contests have taken place at Adelaide Oval, including West Indies\' great escape from the proverbial jaws of defeat to beat Australia by 1-run in a Test match in 1993.\n\n<b>How does the pitch play?</b>\n\nGenerally, the Adelaide Oval is reckoned to be the best batting wicket in Australia. It plays very flat on the first three days of a Test match and as the match wears on it brings the spinners into the game. From 2013, Adelaide became host to the drop-in pitches.\n\n<b>What is a drop-in pitch?</b>\n\nA drop-in pitch is a cricket pitch which is prepared away from the ground or venue in which it is used, and literally "dropped in" to place for a cricket match. This allows multi-purpose venues to host other sports and events with more versatility than a dedicated cricket ground would allow. (source: Wikipedia)\n\nFor more about drop-in pitches, have a look at this <a href="http://www.mcg.org.au/The%20MCG%20Stadium/Portable%20Cricket%20Pitches.aspx" target="_blank" title="See how a drop-in pitch is laid">link</a>\n\nBy <b>Bharath Ramraj</b>', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/40.jpg', 'groundLength': 190.2, 'groundWidth': 126.2, 'otherSports': 'Australian Rules Football (since 1877), Rugby League (1997-1998) as well as archery, athletics, baseball, cycling, american football, highland games, hockey, lacrosse, lawn tennis, rugby union, quoits and soccer)', 'imageId': '189174'}, {'ground': 'Eden Park', 'city': 'Auckland', 'country': 'New Zealand', 'timezone': '+13:00', 'established': 1900, 'capacity': '41,000', 'knownAs': 'Eden Park No. 1', 'ends': 'Broadcasting End, Terraces End', 'homeTeam': 'Auckland', 'floodlights': True, 'curator': 'Mark Perham', 'profile': '<b>Venue description:</b>\n\n With a capacity of 50,000, Eden Park is easily the largest stadium in New Zealand. Home to Auckland cricket since 1910, Eden Park also doubles up as a prominent rugby venue during winter. It became the first venue to host two Rugby World Cup finals in 2011, having held the inaugural final in 1987.\n\nIt may be recalled that New Zealand tasted their first Test success at Eden Park against West Indies in 1955-56. Looking through the other end of the spectrum, it also played host when New Zealand crashed to their lowest total in Test cricket - against England in 1955.\n\nInterestingly Eden Park, which is located in the suburb of Kingsland less than 3km from the CBD, has also been the stage for hockey. British royalty and Dalai Lama. It will be the scene of one of the semi-finals in the upcoming ICC Cricket World Cup 2015.\n\n<b>How does the pitch play?</b>\n\nEden Park features a drop-in pitch and is generally slowish. Good for batting and is hard on the bowlers.\n\n<b>What is a drop-in pitch?</b>\n\nA drop-in pitch is a cricket pitch which is prepared away from the ground or venue in which it is used, and literally "dropped in" to place for a cricket match. This allows multi-purpose venues to host other sports and events with more versatility than a dedicated cricket ground would allow. (source: Wikipedia)\n\nFor more about drop-in pitches, have a look at this <a href="http://www.mcg.org.au/The%20MCG%20Stadium/Portable%20Cricket%20Pitches.aspx" target="_blank" title="See how a drop-in pitch is laid">link</a>\n\nBy <b>Deivarayan Muthu</b>', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/41.jpg', 'otherSports': 'Rugby', 'imageId': '189174'}, {'ground': 'Sky Stadium', 'city': 'Wellington', 'country': 'New Zealand', 'timezone': '+13:00', 'established': 1999, 'capacity': '37,000 (With temporary seating)', 'knownAs': 'Westpac Trust Stadium, Westpac Stadium', 'ends': 'Scoreboard End, City End', 'homeTeam': 'Wellington and Wellington Firebirds', 'floodlights': True, 'curator': 'Brett Sipthorpe ', 'profile': '<b>Venue description:</b>\n\n The Sky Stadium in Wellington is a multipurpose stadium. The first ODI played on this ground between New Zealand the West Indies in 2000 was abandoned, as a result of incessant rain. Since then, it has  gone onto host 21 matches. \n\nDue to its shape and silver coloured external walls, it is colloquially known as "The Cake Tin" (source - Wikipedia)\n\n<b>How does the pitch play?</b>\n\nRain has had a major say in most of the games played here. The Westpac Stadium uses a drop-in pitch like most venues in New Zealand. As with a majority of the drop-in pitches, it tends to side with the batsmen.\n\n<b>What is a drop-in pitch?</b>\n\nA drop-in pitch is a cricket pitch which is prepared away from the ground or venue in which it is used, and literally "dropped in" to place for a cricket match. This allows multi-purpose venues to host other sports and events with more versatility than a dedicated cricket ground would allow. (source: Wikipedia)\n\nFor more about drop-in pitches, have a look at this <a href="http://www.mcg.org.au/The%20MCG%20Stadium/Portable%20Cricket%20Pitches.aspx" target="_blank" title="See how a drop-in pitch is laid">link</a>\n\nBy <b>Bharath Ramraj</b>', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/42.jpg', 'groundLength': 235.0, 'groundWidth': 185.0, 'otherSports': 'Rugby (Wellington Hurricanes, Wellington Lions)', 'imageId': '248472'}, {'ground': 'McLean Park', 'city': 'Napier', 'country': 'New Zealand', 'timezone': '+13:00', 'established': 1911, 'capacity': '22,500', 'knownAs': 'McLean Park', 'ends': 'Centennial Stand End, Embankment End', 'homeTeam': 'Central Districts', 'floodlights': True, 'curator': 'Phil Stoyanoff ', 'profile': "<b>Venue description:</b>\n\n Rugby and Cricket are the two major sports events held at Napier's McLean Park. Established in 1911, the stadium was built on the 10 acres of land donated by Sir Douglas in memory of his father, Sir Donald McLean, who was a local politician and a government official. 'Sir Donald McLean Park' was the official name of the ground, before it took its current name, 'McLean Park.' It is a square dimensional ground, covered by four stands and a huge grass bank behind the sightscreen at one end.\n\nLocated in Hawke's Bay on the eastern coast of the North Island, Napier is one of New Zealand's driest cities, because of which the square at McLean Park doesn't have the spice that other grounds in the country have. The pitch here is regarded as batting-friendly and it is generally considered to be a very good wicket for limited-overs cricket. In fact, it is one of the world's highest scoring grounds at present.\n\nA Test match between hosts New Zealand and Pakistan in 1979 was the first international cricket match to be played at this venue. Since then, the BlackCaps have featured in 9 Test matches, winning one, drawing six and losing two. Quite clearly, not a happy hunting ground for the hosts in the longest format of the game.\n\nFour years later, New Zealand and Sri Lanka locked horns with each other to open McLean Park's ODI account on March 19, 1983. Although enjoying a good run at the start, as years went by, oppositions found ways to tackle New Zealand's strategies at this ground and the BlackCaps have suffered quite a few setbacks in the last 10 years.\n\n<b>How does the pitch play?</b>\n\nMcLean Park is regarded as one of the most batting friendly wickets in the world. The wicket tends to slow up as the game progresses. \n\n<b>Interesting facts about McLean Park:</b>\n\nBrett Lee clocked 160.8kph on March 5, 2005, to record the fastest ball ever bowled by him.\n\nNew Zealand's first floodlit home fixture was played here in 1996. Ten years later, in 2006, the artificial lights were upgraded to meet the latest requirements.\n\nIn March 2009, a fungus, which prevented the growth of grass, forced the groundsmen to shift the 22 yards, ahead of India's 2nd Test match against New Zealand.\n\nBy <b>MS Ramakrishnan</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/44.jpg', 'otherSports': 'Rugby', 'imageId': '189174'}, {'ground': 'Basin Reserve', 'city': 'Wellington', 'country': 'New Zealand', 'timezone': '+13:00', 'capacity': '11,600', 'ends': 'Vance Stand End, Scoreboard End', 'homeTeam': 'Wellington', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/45.jpg', 'imageId': '189174'}, {'ground': 'Narendra Modi Stadium', 'city': 'Ahmedabad', 'country': 'India', 'timezone': '+05:30', 'established': 1982, 'capacity': '132,000', 'knownAs': 'Motera Gujarat Stadium, Sardar Patel Stadium', 'ends': 'Adani Pavilion End, GMDC End', 'homeTeam': 'Gujarat, Gujarat Titans', 'floodlights': True, 'curator': 'Bagira Thakur', 'profile': "<b>Introduction:</b>\n\nPopular as one of the premier cricket grounds in India, the stadium is generally known as the 'Motera Stadium' to avoid confusion with another stadium of the same name in the Navrangpura area. It is owned by the Gujarat Cricket Association and comes under the aegis of the West Zone.\n\n<b>Venue History:</b>\n\nBefore this stadium came into existence, international matches were played at the Ahmedabad Municipal Corporation's stadium, bearing the same name. However, in 1982, the Gujrat government donated a 50-acre land on the banks of the Sabarmati river and the Motera stadium was constructed in a span of only nine months. The first international match to be hosted here was a Test between India and West Indies on November 12, 1983. \n\n<b>Venue Description</b>:\n\nThe Motera stadium has been witness to several important landmarks. It is also the adopted home of the Indian Premier League franchise Rajasthan Royals. The current stands are as follows - GMDC Upper and Lower stands, East Upper and Lower Pavilion, Adani Lower Pavilion, Adani Upper Pavilion, Club Pavilion, and West Pavilion. All stands, except the Club and West Pavilions, consistent two tiers. The Adani Pavilion consists of more than 20 air-conditioned corporate boxes as well as the player dressing rooms. The stadium has 21 entry gates. The ground was renovated in 2006, just before the Champions Trophy. After renovation, state-of-the-art floodlights were added to the stadium along with covered stands, three new pitches and a new outfield.\n\n<b>How does the pitch play?</b>\n\nThe Motera offers a slow wicket. Initially, it was a bowler-friendly track but over the course of time, the pitch lost its spice as it started to slow down. Very few Test games have reached a conclusion over here.\n\n<b>Trivia</b>:\n\nSunil Gavaskar became the first-ever cricketer to score 10,000 runs in Test cricket on this ground - a feat he achieved against Pakistan in 1986-87.\n\nKapil Dev claimed his 432nd Test wicket on this ground to become the highest wicket-taker in the world, breaking Sir Richard Hadlee's record in 1993.\n\nby <b>Sonali Dhulap</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/50.jpg', 'imageId': '189174'}, {'ground': 'King George V Sports Ground', 'city': 'Castel', 'country': 'Guernsey', 'timezone': '+01:00', 'knownAs': 'King George Ground', 'ends': 'De Beauvoir End, Blancs Bois End', 'homeTeam': 'Guernsey', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/563.jpg', 'imageId': '189174'}, {'ground': 'Arun Jaitley Stadium', 'city': 'Delhi', 'country': 'India', 'timezone': '+05:30', 'established': 1883, 'capacity': '48000', 'knownAs': 'Feroz Shah Kotla, Willingdon Pavilion', 'ends': 'Stadium End, Pavilion End', 'homeTeam': 'Delhi, Delhi Capitals', 'floodlights': True, 'profile': "<b>Venue Description</b>:\n\nHome to the Delhi Ranji team and the Delhi Daredevils, the Feroz Shah Kotla, is the second oldest international cricket stadium in India. The stadium gets its name from its location. It is in the vicinity of the Feroz Shah Kotla, a fortress built by Sultan Feroz Shah Tughlaq. Having been established in 1883, the ground has undergone some heavy reconstruction over the years. Colloquially, the locals also call the stadium 'Kotla', which literally means citadel or fortress. The first international game here was a Test match between India and the West Indies in 1948.\n\nThe Feroz Shah Kotla has been a very happy hunting ground for the Indian cricket team. India won 7 successive Tests between 1993-2007. In fact, India have won 9 and drawn 1 of their last 10 Tests here. India last lost a Test match here way back in 1987, a game that saw India getting bowled out for 75 in the first innings. India's ODI record at this stadium isn't bad either. Since April 2005, they have won 6 games here and lost none; one game was cancelled and one was a no result. Their last ODI defeat at Kotla came against Pakistan, where the visitors won by a margin of 159 runs. The win helped Pakistan win the ODI series 4-2 after India had taken a 2-0 lead previously.\n\n<b>How does the pitch play</b>?\n\nOver the years, the pitch at Feroz Shah Kotla has largely been batting friendly. However, in December 2009, the Kotla pitch came under severe criticism after an ODI between India and Sri Lanka had to be called off. The pitch was deemed unfit and dangerous after instances of atrocious uneven bounce off the pitch. Sri Lanka were 83 for 5 when the match officials decided that the game couldn't be continued further, owing to players' safety.\n\nBased on the match referee's report on the game, the stadium was in danger of getting banned for a period of 1-2 years. A ban of more than 14 months would have seen the stadium lose out on hosting any games during the 2011 World Cup. However, the ICC decided to ban it for just 12 months, paving the way for Kotla to stage its share of 4 World Cup games, including India's game against the Netherlands.\n\n<b>Interesting Records at Feroz Shah Kotla</b>:\n\nThe stadium witnessed Anil Kumble's famous 10/74 in an innings, against Pakistan in 1999. With these figures, Kumble became only the second bowler after Jim Laker to take all the ten wickets in an innings.\n\nIn 1983, Sunil Gavaskar scored his 29th Test ton at this venue, equalling Sir Donald Bradman's record for the most number of centuries in Test cricket.\n\nIn 2005, Sachin Tendulkar went past Sunil Gavaskar's record of 34 Test centuries, registering his 35th Test ton in the second Test against Sri Lanka at this venue.\n\nBy <b>Sidhant Maheshwari</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/51.jpg', 'imageId': '189174'}, {'ground': 'BCA Stadium', 'city': 'Vadodara', 'country': 'India', 'timezone': '+05:30', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/1843.jpg', 'imageId': '189174'}, {'ground': 'Newlands', 'city': 'Cape Town', 'country': 'South Africa', 'timezone': '+02:00', 'capacity': '25,000', 'knownAs': "Sahara Park; Newlands; Western Province Cricket Club; Newlands 'A'", 'ends': 'Wynberg End, Kelvin Grove End', 'homeTeam': 'Western Province', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/52.jpg', 'imageId': '189174'}, {'ground': 'Riverside Ground', 'city': 'Chester-le-Street', 'country': 'England', 'timezone': '+01:00', 'established': 1995, 'capacity': '5000 (17000 for internationals)', 'ends': 'Finchale End, Lumley End', 'homeTeam': 'Durham', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/60.jpg', 'imageId': '189174'}, {'ground': 'Forthill', 'city': 'Dundee', 'country': 'Scotland', 'timezone': '+01:00', 'homeTeam': 'Scotland', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/573.jpg', 'imageId': '189174'}, {'ground': 'Sophia Gardens', 'city': 'Cardiff', 'country': 'Wales', 'timezone': '+01:00', 'capacity': '5500 (15,000 after redevelopment)', 'knownAs': 'The SWALEC Stadium', 'ends': 'River Taff End, Cathedral Road End', 'homeTeam': 'Glamorgan', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/62.jpg', 'imageId': '189174'}, {'ground': 'Cronkbourne Sports and Social Club Ground', 'city': 'Tromode', 'country': 'Isle of Man', 'timezone': '+01:00', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/1438142.jpg', 'imageId': '189174'}, {'ground': 'County Ground', 'city': 'Bristol', 'country': 'England', 'timezone': '+01:00', 'established': 1889, 'capacity': '7000 (15,000 ODIs)', 'knownAs': "The Royal &amp; Sun Alliance County Ground; Ashley Down Ground; Fry's Ground; Phoenix County Ground", 'ends': 'Pavilion End, Ashley Down Road End', 'homeTeam': 'Gloucestershire', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/63.jpg', 'imageId': '189174'}, {'ground': 'Emirates Old Trafford', 'city': 'Manchester', 'country': 'England', 'timezone': '+01:00', 'established': 1857, 'capacity': '19000', 'ends': 'Stretford End, Brian Statham End', 'homeTeam': 'Lancashire', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/65.jpg', 'imageId': '717716'}, {'ground': 'Headingley', 'city': 'Leeds', 'country': 'England', 'timezone': '+01:00', 'established': 1890, 'capacity': '17000', 'knownAs': 'Headingley Grounds', 'ends': 'Kirkstall Lane End, Football Stand End', 'homeTeam': 'Yorkshire', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/66.jpg', 'imageId': '717701'}, {'ground': 'Harare Sports Club', 'city': 'Harare', 'country': 'Zimbabwe', 'timezone': '+02:00', 'capacity': '10,000', 'knownAs': 'Salisbury Sports Club', 'ends': 'City End, Club House End', 'homeTeam': 'Rhodesia, Zimbabwe, Mashonaland', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/69.jpg', 'imageId': '189174'}, {'ground': 'Tribhuvan University International Cricket Ground', 'city': 'Kirtipur', 'country': 'Nepal', 'timezone': '+05:45', 'established': 1998, 'capacity': '20,000', 'knownAs': 'Kirtipur Cricket Ground', 'ends': 'Pavillion End, Chobar End', 'homeTeam': 'Nepal', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/458.jpg', 'imageId': '189174'}, {'ground': 'SuperSport Park', 'city': 'Centurion', 'country': 'South Africa', 'timezone': '+02:00', 'capacity': '22,000', 'knownAs': 'SuperSport Centurion; Centurion Park', 'ends': 'Pavilion End, Hennops River End', 'homeTeam': 'Northern Transvaal, Northerns', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/75.jpg', 'imageId': '189174'}, {'ground': 'Shaheed Veer Narayan Singh International Stadium', 'city': 'Raipur', 'country': 'India', 'timezone': '+05:30', 'established': 2008, 'capacity': '65,000', 'knownAs': 'Shaheed Veer Narayan Singh International Cricket Stadium,  Chhattisgarh International Cricket Stadium', 'ends': 'North End, South End', 'homeTeam': 'Delhi Daredevils, Chhattisgarh', 'floodlights': True, 'profile': "<b>Venue Description</b>:\n\nEstablished in 2008, the SVNS International Cricket Stadium is one of the newest state-of-the-art stadiums in India. The ground hosted its first major game in 2010, when the Canadian national team played against Chhattisgarh in a one-day match. In 2013, the stadium made its debut in the IPL when it was chosen as the second home venue for the Delhi Daredevils. The Daredevils won both their games here, against Pune Warriors India and Kolkata Knight Riders.\n\nFew of the 2014 IPL season matches were supposed to be played here, but due to the Lok Sabha elections and the rescheduling that followed afterwards, the venue couldn't host any games. However, the venue played host to eight Champions League T20 matches of the 2014 edition. All the six qualifiers plus two group stage games, were held here.\n\n<b>How does the pitch play</b>?\n\nThe 22-yards strip usually offers a good balance between the bat and the ball. Two IPL and eight CLT20 games have been played at this venue and only once a team has crossed 200 here. Apart from that, from time to time, the pitch offers some assistance to the pacers as well as the spinners. In all, it is a good sporting wicket, with something there for everyone to exploit.\n\nby <b>Sidhant Maheshwari</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/335.jpg', 'imageId': '189174'}, {'ground': 'Boland Park', 'city': 'Paarl', 'country': 'South Africa', 'timezone': '+02:00', 'capacity': '10000', 'knownAs': 'Boland Bank Park', 'ends': 'Riebeeck Kelders End, Stables End', 'homeTeam': 'Boland', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/207.jpg', 'imageId': '189174'}, {'ground': 'Bill Pippen Oval', 'city': 'Gold Coast', 'country': 'Australia', 'timezone': '+10:00', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/1438034.jpg', 'imageId': '189174'}, {'ground': 'Maharaja Yadavindra Singh International Cricket Stadium, Mullanpur', 'city': 'New Chandigarh', 'country': 'India', 'timezone': '+05:30', 'established': 2021, 'capacity': '38000', 'knownAs': 'Mullanpur, Mullanpur Cricket Stadium', 'homeTeam': 'Punjab, Punjab Kings', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/851.jpg', 'imageId': '189174'}, {'ground': 'Melbourne Cricket Ground', 'city': 'Melbourne', 'country': 'Australia', 'timezone': '+11:00', 'established': 1854, 'capacity': '100000 (approx, including standing room)', 'knownAs': 'The MCG, The "G"', 'ends': 'Members End, Great Southern Stand End', 'homeTeam': 'Australia, Victoria', 'floodlights': True, 'curator': 'Tony Ware', 'profile': '<b>Venue description:</b>\n\nThe Melbourne Cricket Club, founded in 1838 was forced to move several sites, before it could finally choose the current location, in Yarra Park, Melbourne, Victoria, to build the epic Melbourne Cricket Ground (MCG) stadium in 1853. The MCG, currently is the largest cricket stadium on earth and it is also the 11th largest stadium in the world. Cricket, Rugby and Australian Rules Football are the major sporting events held regularly at the MCG, while it has also played host to the 1956 Summer Olympics, the 2006 Commonwealth Games and a few of the FIFA World Cup qualifier games.\n\nThe MCG is colloquially referred by the locals as \'The G\'. Due to safety measures, the MCG\'s capacity, which was well over 100000, was reduced to its current arrangement. The MCG gave birth to the Test match format on March 15, 1877, when Australia and England took on each other in a timeless match. Since then, the ground has been center-stage to over 100 Test matches, including the famous Boxing Day Test match, that is held every year on December 26. Interestingly, cricket\'s first ODI match was also held at the MCG.\n\nThe 171m x 146m field at the MCG is surrounded by four stands - Great Southern Stand, MCC Members\' Reserve, Olympic Stand and Ponsford Stand - named in honour of Victorian batsman Bill Ponsford. From the first wooden members\' stand in 1854, the MCG has seen a series of enhancements to take its current shape. The infamous Bay 13, known as one of the worst behaved sections in the cricketing fraternity, is a part of the Southern Stand.\n\nThe first scoreboard at the MCG was built in 1882. Since then, it has taken many forms and is currently the best and the largest scoreboard available in Australia - state-of-the-art LED-high-definition screen which is 25.24 metres wide and 13.17 metres high. The current facility enables one to see both, batting and bowling cards on one screen. Also, it was at the MCG that Australia\'s first full colour video scoreboard was put in place. The world\'s first all-colour cricket scoreboard with instant replays was installed at the MCG.\n\n<b>How does the pitch play?</b>\n\nThe 22-yards at the MCG is considered to be one of the most competitive surfaces in the world. It offers a fine balance between bat and ball. While the bowlers get some assistance early on with mostly genuine bounce, as it gets old, the batsmen can play their strokes freely. However, generally, the spinners do not get much of a purchase at the MCG.\n\nSince 1996, MCG has been host to the drop-in pitches. \n\n<b>What is a drop-in pitch?</b>\n\nA drop-in pitch is a cricket pitch which is prepared away from the ground or venue in which it is used, and literally "dropped in" to place for a cricket match. This allows multi-purpose venues to host other sports and events with more versatility than a dedicated cricket ground would allow. (source: Wikipedia)\n\nFor more about drop-in pitches, have a look at this <a href="http://www.mcg.org.au/The%20MCG%20Stadium/Portable%20Cricket%20Pitches.aspx" target="_blank" title="See how a drop-in pitch is laid">link</a>\n\n<b>Interesting facts about the MCG</b>:\n<ul><li>It was at the MCG, on February 11, 1984, that an ODI ended in a tie for the first time, both West Indies and Australia made 222.</li>\n<li>The MCG is referred to as the \'Spiritual Home of Australian Sport\'.</li>\n<li>The light towers at the MCG are the tallest for any sporting venue across the globe.</li>\n<li>According to a rumour, on January 2, 1955, groundsman Jack House decided to water the pitch on the rest day of the 3rd Ashes Test match between Australia and England to save the 22 yards, after it developed huge cracks on a hot Saturday. However, the Victorian Cricket Association and the Melbourne Cricket Club held an inquiry into the matter and denied the rumour.</li>\n<li>On January 2, 1961, West Indies\' Joe Solomon was ruled out hit-wicket, after his hat fell onto the stumps while playing at a Richie Benaud delivery.</li>\n<li>In 1981, Indian batsman Sunil Gavaskar took Chetan Chauhan off the field in a Test match, after being disappointed with an LBW decision against him.</li>\n<li>The infamous incident of Greg Chappell, Australia\'s captain, asking Trevor Chappell to under-arm the final delivery of the match, when New Zealand needed a six off the last ball to the tie the ODI, took place at the MCG on February 1, 1981. Although it was not against the laws, the incident was considered as \'against the spirit of the game.\'</li>\n<li>It was at this ground, in 1995, that umpire Darrell Hair called Sri Lankan spinner Muttiah Muralitharan for throwing the ball(chucking), seven times during the Boxing Day Test match.</li>\n<li>The MCG is part of the yearly-Melbourne Marathon and has also hosted a few rock concerts.</li>\n<li>On 27 August 1999, an electrical fault caused the city end scoreboard to catch fire, thereby delaying the start of an AFL match by half an hour.</li>\n<li>The MCG is where the Super Sopper was used for the first time.</li>\n<li>On Day 1 of the 2013 Boxing Day Test between Australia and England a crowd count of 91,092, was a record for a single-day attendance in Test match history.</li>\n<li>During World War II, from 1942 to 1945, the MCG was used for military purposes and more than 200,000 personnel camped at the venue.</li>\n<li>Australia\'s first ever bicycle race was held at the MCG in 1869.</li>\n<li>The MCG also hosted Victoria\'s first ever Tennis game in 1878.</li>\n</ul>\nBy <b>MS Ramakrishnan</b>\n', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/87.jpg', 'groundLength': 172.9, 'groundWidth': 147.8, 'otherSports': 'Australian Rules Football, Soccer, Rugby Union, Rugby League, Lawn Bowls, Squash', 'imageId': '189174'}, {'ground': 'The Wanderers Stadium', 'city': 'Johannesburg', 'country': 'South Africa', 'timezone': '+02:00', 'established': 1956, 'capacity': '34000', 'knownAs': 'Kent Park', 'ends': 'Corlett Drive End, Golf Course End', 'homeTeam': 'Gauteng, Transvaal', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/88.jpg', 'imageId': '189174'}, {'ground': 'Sheikh Zayed Stadium', 'city': 'Abu Dhabi', 'country': 'United Arab Emirates', 'timezone': '+04:00', 'established': 2004, 'capacity': '20,000', 'knownAs': ' President His Highness Sheikh Zayed bin Sultan Al Nahyan', 'ends': 'North End, Pavilion End', 'homeTeam': 'United Arab Emirates', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/94.jpg', 'imageId': '731716'}, {'ground': 'Sportpark Duivesteijn', 'city': 'Voorburg', 'country': 'Netherlands', 'timezone': '+02:00', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/1437791.jpg', 'imageId': '189174'}, {'ground': 'Buffalo Park', 'city': 'East London', 'country': 'South Africa', 'timezone': '+02:00', 'capacity': '15000', 'ends': 'Buffalo Park Drive End, Bunkers Hill End', 'homeTeam': 'Border', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/99.jpg', 'imageId': '189174'}, {'ground': 'Seddon Park', 'city': 'Hamilton', 'country': 'New Zealand', 'timezone': '+13:00', 'established': 1950, 'capacity': '10,000 with flexibility to 30 000', 'knownAs': 'Trust Bank Park; WestpacTrust Park;Westpac Park', 'ends': 'Members End, City End', 'homeTeam': 'Northern Districts', 'floodlights': True, 'curator': 'Andy Brown', 'profile': '<b>Venue description:</b>\n\nNamed after former New Zealand Prime Minister, Richard John Seddon, Seddon Park, is the 4th largest ground in New Zealand. Originally a cricket ground, the venue has also been used for hockey, rugby and rugby league matches. Previously named as Trust Bank Park, the stadium has reverted to its original name at the end of the bank sponsorship.\n\nThe stadium hosted its first One Day International on 15 February 1981. The hosts beat the visiting Indian team by a convincing margin of 57 runs. \n\n<b>How does the pitch play?</b>\n\nSeddon Park is a well-grassed stadium with a centre block of 9 pitches, running approximately North/South. These are usually very good batting tracks (source: Wikipedia).  \n\nBy <b>Pradeep Krishnamurthy</b>', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/100.jpg', 'otherSports': 'Hockey, Rugby and Rugby League', 'imageId': '189174'}, {'ground': 'Bharat Ratna Shri Atal Bihari Vajpayee Ekana Cricket Stadium', 'city': 'Lucknow', 'country': 'India', 'timezone': '+05:30', 'established': 2017, 'capacity': '50000', 'knownAs': 'Ekana International Cricket Stadium', 'homeTeam': 'Uttar Pradesh, Lucknow Super Giants', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/485.jpg', 'imageId': '189174'}, {'ground': 'Vidarbha Cricket Association Stadium', 'city': 'Nagpur', 'country': 'India', 'timezone': '+05:30', 'established': 2008, 'capacity': '45,000', 'ends': 'Secretary End, Pavilon End', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/228.jpg', 'imageId': '189174'}, {'ground': 'Barabati Stadium', 'city': 'Cuttack', 'country': 'India', 'timezone': '+05:30', 'established': 1958, 'capacity': '45000', 'ends': 'Mahanadi River End River End, Pavilion End', 'homeTeam': 'India, Odisha', 'floodlights': True, 'profile': '<b>Venue Description</b>\n\nThe Barabati stadium, situated in Cuttack, Odisha, has been a host to numerous international matches and the ground is of truly rich sporting heritage. It is the home ground of the Odisha team. It has also staged IPL matches. Even football matches have been held at the stadium.\n\nIn fact, the Barabati stadium is one of the oldest grounds in India. It can be encapsulated by the fact that back in 1961, MCC had played a game here against East Zone. The West Indies too had played a tour game in 1974-75. International cricket came to the Barabati stadium in 1982, when India beat England to clinch the ODI series 2-1. Interestingly, It was the third ODI held in this country.\n\nIn 1987, it got the chance to host a Test match between India and Sri Lanka. However, since the rain-ruined game played between India and New Zealand in 1995, Test matches have not been allotted to the stadium. Unfortunately, due to crowd disruptions, when South Africa took on India in a T20I in October 2015, the stadium hit the headlines for all the wrong reasons.\n\nOne of the key factors to consider about Barabati stadium is that it is quite far away from the airport. As a result, it has come under some criticism, especially from visiting teams.\n\n<b>Pitch Conditions:</b>\n\nOver the years, the wickets have been noted for variable bounce and assisting the spinners. Tweakers like Anil Kumble, Narendra Hirwani and Maninder Singh have shone brightly. Hirwani taking a 6-for on a turner in the Test against New Zealand in 1995 gives an inkling about the deck helping the spinners. However, it has to be said that even the pacers have taken advantage of the variable bounce and on occasions, succeeded.', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/103.jpg', 'imageId': '189174'}, {'ground': 'Wanderers Cricket Ground', 'city': 'Windhoek', 'country': 'Namibia', 'timezone': '+02:00', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/363.jpg', 'imageId': '189174'}, {'ground': 'Manuka Oval', 'city': 'Canberra', 'country': 'Australia', 'timezone': '+11:00', 'established': 1929, 'capacity': '13,550', 'knownAs': 'Manuka Oval. Previously known as Manuka Circle Park', 'ends': 'Pool End, Mall End', 'homeTeam': 'Australian Capital Territory, New South Wales, Pri', 'floodlights': True, 'curator': 'Brad Van Dam', 'profile': "<b>Venue description:</b>\n\n The Manuka Oval is located in the suburb of Griffith in Manuka, Canberra. The stadium plays host to a number of sporting events other than cricket, including Australian football.\n\nThe ground was originally an open park called the 'Manuka Circle Park'. After an enclosing fence was built in 1929, it came to be recognised as the Manuka Oval. The ground hosts the yearly game between the Prime Minister’s XI (a team picked by the Australian PM) and an overseas touring team. \n\nThe ground is home to the ACT Comets, a cricket team representing Australian Capital Territory. The ground also offers a beautiful backdrop with trees encircling the entire oval, many of which were planted way back in the 1920s. \n\n<b>How does the pitch play?</b>\n\nNot many games have been hosted by Manuka Oval - which makes it difficult to gauge how the pitch may play. But looking at history, it is traditionally a very good batting wicket. \n\nBy <b>Sidhant Maheshwari</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/123.jpg', 'groundLength': 179.0, 'groundWidth': 150.0, 'otherSports': 'Australian Rules Football', 'imageId': '189174'}, {'ground': 'The Village', 'city': 'Dublin', 'country': 'Ireland', 'timezone': '+01:00', 'ends': 'Dublin Road End, Castle End', 'homeTeam': 'Ireland', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/370.jpg', 'imageId': '189174'}, {'ground': 'Hagley Oval', 'city': 'Christchurch', 'country': 'New Zealand', 'timezone': '+13:00', 'established': 1886, 'capacity': '20,000', 'knownAs': 'Hagley Oval', 'homeTeam': 'Canterbury', 'curator': 'Rupert Bool', 'profile': '<b>Venue description:</b>\n\nChristchurch waited almost three years since 2011 for international cricket to return to the city. Most parts of the city were severely damaged by the earthquake in February 2011, including Lancaster Park, previously the venue for international cricket in Christchurch. The last game played here was an ODI that involved New Zealand and Pakistan. Later in 2013, Canterbury Cricket got the approval from the Environment Court to develop Hagley Oval as an international venue. \n\nHagley Oval is situated in the central city of Christchurch. The first time the Plunket Shield, New Zealand\'s domestic first-class cricket tournament, was played here was in 1907. It is the home ground of Canterbury who have been playing here since 1979. The venue has hosted three Women\'s Test matches and six Women\'s ODIs. Apart from that, two World Cup qualifier games were held here in January 2014. Scotland played both the matches, one against Kenya and the other against Canada. \n\nThe venue made its Test debut on Boxing Day 2014, when New Zealand and Sri Lanka locked horns to kick-off the 2-Test series. It is also the ground which will launch the 2015 World Cup, again involving New Zealand and Sri Lanka.\n\n<b>How does the pitch play?</b>\n\nOnly one Test match has been played on this venue. But it has come for praise from New Zealand skipper, Brendon McCullum who noted the pitch kept a good pace throughout the four days\' play. Angelo Mathews had this to say about the pitch - "The wicket was very good. It had bounce throughout the game and whoever had the skill could let the ball talk."\n\nSix of these wickets are made of Waikari Clay and five are made from Kakanui clay.  The clay is covered with ryegrass.\n\nBy <b>Akshay Maanay</b>', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/371.jpg', 'imageId': '189174'}, {'ground': 'University Oval', 'city': 'Dunedin', 'country': 'New Zealand', 'timezone': '+13:00', 'established': 1920, 'capacity': '3500 (Increased to 6000 by temporary seating)', 'knownAs': 'University Oval, "Varsity Oval"', 'ends': 'Southern End, Northern End', 'homeTeam': 'Otago, Otago Volts', 'curator': 'Tom Tamati', 'profile': '<b>Venue description:</b>\n\n The University Oval is located at Logan Park, Dunedin, New Zealand. The stadium derives its name from the fact that it was originally owned by the University of Otago. Apart from the Otago Cricket Association, the ground is also home to the University of Otago Rugby Football Club.\n\nThe ground makes up for its low seating capacity with picturesque surroundings, including a landscape of trees around the ground. The grass banks are another great feature as these embankments provide the spectators a way to relax and enjoy live cricket at the same time.\n\nNotably, the Umpire Decision Review System (UDRS) was officially used for the first time at this very ground. It was launched during the first Test match between New Zealand and Pakistan in 2009.\n\nThe University Oval hosted its first Test match in 2008, between New Zealand and Bangladesh. Till date, the ground has hosted six Tests and only two ODIs.\n\n<b>How does the pitch play?</b>\n\nWeather played a major part in most of the matches played here. A low and slow surface with the Kakanui clay used, grass being the binding agent.\n\nBy <b>Sidhant Maheshwari</b>', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/116.jpg', 'otherSports': 'Rugby', 'imageId': '189174'}, {'ground': 'Saxton Oval', 'city': 'Nelson', 'country': 'New Zealand', 'timezone': '+13:00', 'established': 2009, 'capacity': '5,000', 'knownAs': 'Saxton Oval', 'homeTeam': ' Central Districts', 'profile': "<b>Venue description:</b>\n\nSaxton Oval is also known as Saxton Field is located at Nelson, New Zealand. It came into existence when Nelson Cricket Association moved from their original home ground Trafalgar Park. The Association got an approval of $400,000 from Lottery Community Facilities Funding to build the cricket, athletics and football pavilion.\n\nOnce the ground was ready, the first ever match that it hosted was a T20 game between game Central Districts and Canterbury in 2009. In the following seasons, first-class and List A matches were played here. In 2010, New Zealand Women and Australia Women played a T20I, it was the first international game to be played at this stadium.\n\nSo far only one ODI has been played at this venue, it was between New Zealand and West Indies in January 2014. Both teams went into this game with the series being 1-1. Martin Guptill led the batting charge and was supported by the rest as the Kiwis put up a competitive total of 285 in their 50 overs. West Indies' reply was put to a halt by rain, which stopped play at the 34th over with the score being 134/5. New Zealand went on to win the game by 58 runs as per D/L. \n\n<b>How does the pitch play?</b>\n\nSo far only one ODI has taken place - which isn't really a parameter to judge the character of the pitch.\n\nBy <b>Akshay Manaay</b>", 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/372.jpg', 'otherSports': 'Rugby League', 'imageId': '189174'}, {'ground': 'Greenfield International Stadium', 'city': 'Thiruvananthapuram', 'country': 'India', 'timezone': '+05:30', 'capacity': '50000', 'knownAs': 'Trivandrum International Stadium', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/506.jpg', 'otherSports': 'Football', 'imageId': '189174'}, {'ground': 'Sylhet International Cricket Stadium', 'city': 'Sylhet', 'country': 'Bangladesh', 'timezone': '+06:00', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/379.jpg', 'imageId': '189174'}, {'ground': 'Barsapara Cricket Stadium', 'city': 'Guwahati', 'country': 'India', 'timezone': '+05:30', 'established': 2012, 'capacity': '40000', 'knownAs': 'Dr. Bhupen Hazarika Cricket Stadium, Assam Cricket Association Stadium', 'ends': 'Media End, Pavilion End', 'homeTeam': 'Assam', 'floodlights': True, 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/380.jpg', 'imageId': '731778'}, {'ground': 'Pallekele International Cricket Stadium', 'city': 'Pallekele', 'country': 'Sri Lanka', 'timezone': '+05:30', 'capacity': '35000', 'ends': 'Hunnasgiriya End, Rikillagaskada End', 'homeTeam': 'Kandurata ', 'floodlights': True, 'curator': 'Asitha Wijesinghe', 'imageUrl': 'http://i.cricketcb.com/i/stats/fth/540x303/venue/images/254.jpg', 'groundLength': 80.0, 'groundWidth': 75.0, 'imageId': '717877'}]
